glue.command(["multi-unset", "link-target", "cov_primer_probe", "-a", "cov_primer_probe_assay"]);
glue.command(["multi-unset", "link-target", "cov_primer_probe", "-a", "seq_match"]);
glue.command(["multi-unset", "link-target", "variation", "-a", "cov_pp_seq_mismatch"]);
glue.command(["multi-unset", "link-target", "cov_primer_probe", "-a", "seq_insertion"]);
glue.command(["multi-unset", "link-target", "cov_primer_probe", "-a", "seq_deletion"]);
glue.command(["multi-delete", "cov_primer_probe", "-a"]);
glue.command(["multi-delete", "cov_primer_probe_assay", "-a"]);
glue.command(["multi-delete", "variation", "-w", "name like '%cov_pp_%'"]);

var ppObjs;

// static map of concrete / ambiguous NT chars to the set of concrete chars which match them.
var ntCharToSubChars = {
    "A": ["A"],
	"C": ["C"],
	"G": ["G"],
	"T": ["T"],
	"R": ["A", "G"],
	"Y": ["C", "T"],
	"K": ["G", "T"],
	"M": ["A", "C"],
	"S": ["C", "G"],
	"W": ["A", "T"],
	"B": ["C", "G", "T"],
	"D": ["A", "G", "T"],
	"H": ["A", "C", "T"],
	"V": ["A", "C", "G"],
	"N": ["A", "C", "G", "T"]
}

//build map concrete / ambiguous NT chars to a list of concrete / ambig chars which match them.
var ntCharToAllowed = {};

_.each(_.pairs(ntCharToSubChars), function(pair) {
	var ntChar = pair[0];
	var subChars = pair[1];
	var allowed;
	if(subChars.length == 1) {
		allowed = [ntChar];
	} else {
		var fullSubChars = subChars.slice(); // copy array
		_.each(_.pairs(ntCharToSubChars), function(pair2) {
			if(_.difference(pair2[1], subChars).length == 0 && fullSubChars.indexOf(pair2[0]) < 0) {
				fullSubChars.push(pair2[0]);
			}
		});
		allowed = fullSubChars;
	}
	ntCharToAllowed[ntChar] = allowed;
});

var articPrimers;

glue.inMode("module/tabularUtilityTab", function() {
	// load primers and probes from Nuno's table.
	ppObjs = glue.tableToObjects(glue.command(["load-tabular", "tabular/faria_probes_primers/Primers_probes.txt"]));
	_.each(ppObjs, function(ppObj) {
		ppObj["AssayType"] = "diagnostic_amplification";
		ppObj["AssayTypeDisplay"] = "Amplification for diagnostics";
	});
	// load artic V3 primers
	articPrimers = glue.tableToObjects(glue.command(["load-tabular", "tabular/artic_primers/nCoV-2019_V3.tsv"]));
});

_.each(articPrimers, function(articPrimer) {
	ppObjs.push({
		"Assay": "nCoV-2019 nanopore primers V3",
		"AssayType": "whole_genome_sequencing",
		"AssayTypeDisplay": "Whole genome sequencing",
		"Organisation": "ARTIC Network", 
		"Reference": "https://github.com/artic-network/artic-ncov2019",
		"Name_primer_or_probe": articPrimer.name,
		"Sequence" : articPrimer.seq
	});
});

// special variation for detecting deletions anywhere on the genome.
glue.inMode("reference/REF_MASTER_WUHAN_HU_1/feature-location/whole_genome", function() {
	glue.command(["create", "variation", "cov_pp_any_deletion", "-t", "nucleotideDeletion", "--nucleotide", 1, 29903]);
	glue.inMode("variation/cov_pp_any_deletion", function() {
		glue.command(["set", "metatag", "ALLOW_PARTIAL_COVERAGE", true]);
	});
});

_.each(ppObjs, function(ppObj) {
	var assayID = ppObj["Assay"].trim().replace(" ", "_");
	if(assayID == "See_note") {return;}
 	var createResult = glue.command(["create", "custom-table-row", 
 		"--allowExisting", "cov_primer_probe_assay", assayID]);
 	if(createResult.okResult.number != 0) {
 		glue.inMode("custom-table-row/cov_primer_probe_assay/"+assayID, function() {
 			glue.command(["set", "field", "display_name", ppObj["Assay"].trim()]);
 			var organisation = ppObj["Organisation"];
 			if(assayID.indexOf("HKU") == 0) {
 				organisation = organisation + " (HKU)";
 			}
 			glue.command(["set", "field", "organisation", organisation.trim()]);
 			glue.command(["set", "field", "url", ppObj["Reference"].trim()]);
 			glue.command(["set", "field", "assay_type", ppObj["AssayType"].trim()]);
 			glue.command(["set", "field", "assay_type_display", ppObj["AssayTypeDisplay"].trim()]);
 		}); 	 	
 	}
 	var ppID = ppObj["Name_primer_or_probe"].trim().replace(" ", "_");
 	glue.logInfo("Loading primer/probe "+ppID);
 	glue.command(["create", "custom-table-row", "cov_primer_probe", ppID]);
	var rawSequence = ppObj["Sequence"].trim();
	
	// sanitise the incoming sequence and compute its reverse complement
	var processedSequenceFwd = processRawSequence(rawSequence);
	var processedSequenceRev;
	glue.inMode("module/covFastaUtility", function() {
		processedSequenceRev = glue.command(["reverse-complement", "string", "--fastaString", processedSequenceFwd]).reverseComplementFastaResult.reverseComplement;
	});
	
	// use ntCharToRegex to construct forward and reverse regexes for each primer/probe sequence.
	// store the results in the schema extension table.
	var sequenceFwdRegex = sequenceToRegex(processedSequenceFwd);
	var sequenceRevRegex = sequenceToRegex(processedSequenceRev);
	
 	glue.inMode("custom-table-row/cov_primer_probe/"+ppID, function() {
 		glue.command(["set", "field", "display_name", ppObj["Name_primer_or_probe"].trim()]);
 		glue.command(["set", "field", "sequence_fwd", processedSequenceFwd]);
 		glue.command(["set", "field", "sequence_fwd_regex", sequenceFwdRegex]);
 		glue.command(["set", "field", "sequence_rev", processedSequenceRev]);
 		glue.command(["set", "field", "sequence_rev_regex", sequenceRevRegex]);
 		glue.command(["set", "link-target", "cov_primer_probe_assay", "custom-table-row/cov_primer_probe_assay/"+assayID]);
 	});
 	
 	// create "match anywhere" forward and reverse variations based on these regexes.
 	var fwdVariationName = "cov_pp_match_fwd:"+ppID;
 	var revVariationName = "cov_pp_match_rev:"+ppID;
	glue.inMode("reference/REF_MASTER_WUHAN_HU_1/feature-location/whole_genome", function() {
		glue.command(["create", "variation", fwdVariationName, "-t", "nucleotideRegexPolymorphism", "--nucleotide", 1, 29903]);
		glue.inMode("variation/"+fwdVariationName, function() {
			glue.command(["set", "metatag", "REGEX_NT_PATTERN", sequenceFwdRegex]);
		});
		glue.command(["create", "variation", revVariationName, "-t", "nucleotideRegexPolymorphism", "--nucleotide", 1, 29903]);
		glue.inMode("variation/"+revVariationName, function() {
			glue.command(["set", "metatag", "REGEX_NT_PATTERN", sequenceRevRegex]);
		});
	});
	
	// scan the reference sequence for these "match anywhere" variations to detect the start and end points
	// and whether the primer is forward or reverse.
	var fwdHitObjs;
	var revHitObjs;
	glue.inMode("alignment/AL_GISAID_UNCONSTRAINED/member/cov-gisaid/EPI_ISL_402125", function() {
		fwdHitObjs = glue.tableToObjects(glue.command(["variation", "scan", 
			"-r", "REF_MASTER_WUHAN_HU_1", "-f", "whole_genome", 
			"--whereClause", "name = '"+fwdVariationName+"'", "--showMatchesAsTable"]));
		revHitObjs = glue.tableToObjects(glue.command(["variation", "scan", 
			"-r", "REF_MASTER_WUHAN_HU_1", "-f", "whole_genome", 
			"--whereClause", "name = '"+revVariationName+"'", "--showMatchesAsTable"]));
	});
	// set these on the custom table.
 	glue.inMode("custom-table-row/cov_primer_probe/"+ppID, function() {
 		var refHits = fwdHitObjs.length + revHitObjs.length;
 		glue.command(["set", "field", "ref_hits", refHits]);
 		if(refHits == 1) {
 			if(fwdHitObjs.length == 1) {
 	 	 		glue.command(["set", "field", "sequence_to_scan", processedSequenceFwd]);
 	 	 		glue.command(["set", "field", "fwd_orientation", true]);
 	 	 		glue.command(["set", "field", "ref_start", fwdHitObjs[0].queryNtStart]);
 	 	 		glue.command(["set", "field", "ref_end", fwdHitObjs[0].queryNtEnd]);
 	 	 		glue.command(["set", "field", "length", processedSequenceFwd.length]);
 			} else {
 	 	 		glue.command(["set", "field", "sequence_to_scan", processedSequenceRev]);
 	 	 		glue.command(["set", "field", "fwd_orientation", false]);
 	 	 		glue.command(["set", "field", "ref_start", revHitObjs[0].queryNtStart]);
 	 	 		glue.command(["set", "field", "ref_end", revHitObjs[0].queryNtEnd]);
 	 	 		glue.command(["set", "field", "length", processedSequenceRev.length]);
 			}
 		} else 
 			// these three sequences have mismatches with the reference as of 30/3/2020
 			// so we need to populate their location details explicitly
 			if(ppID == "RdRP_SARSr-P1") {
 	 		glue.command(["set", "field", "sequence_to_scan", processedSequenceFwd]);
 	 		glue.command(["set", "field", "fwd_orientation", true]);
 	 		glue.command(["set", "field", "ref_start", 15469]);
 	 		glue.command(["set", "field", "ref_end", 15494]);
 	 		glue.command(["set", "field", "length", 26]);
 		} else if(ppID == "RdRP_SARSr-R1") {
 	 		glue.command(["set", "field", "sequence_to_scan", processedSequenceRev]);
 	 		glue.command(["set", "field", "fwd_orientation", false]);
 	 		glue.command(["set", "field", "ref_start", 15505]);
 	 		glue.command(["set", "field", "ref_end", 15530]);
 	 		glue.command(["set", "field", "length", 26]);
 		} else if(ppID == "NIID_2019-nCOV_N_R2") {
 	 		glue.command(["set", "field", "sequence_to_scan", processedSequenceRev]);
 	 		glue.command(["set", "field", "fwd_orientation", false]);
 	 		glue.command(["set", "field", "ref_start", 29263]);
 	 		glue.command(["set", "field", "ref_end", 29282]);
 	 		glue.command(["set", "field", "length", 20]);
 		} else {
 			glue.log("SEVERE", "Forward hits for "+ppID+": "+fwdHitObjs.length);
 			glue.log("SEVERE", "Reverse hits for "+ppID+": "+revHitObjs.length);
 			throw new Error("Primer/probe sequence "+ppID+" not found exactly once in the Wuhan-Hu-1 reference strain");
 		}
 	});

});

var ppObjs = glue.tableToObjects(glue.command(["list", "custom-table-row", "cov_primer_probe", 
	"id", "sequence_to_scan", "fwd_orientation", "ref_start", "ref_end", "sequence_fwd_regex", "sequence_rev_regex", "length"]));

_.each(ppObjs, function(ppObj) {
	var matchVariationName = "cov_pp_match:"+ppObj.id;
	var pattern;
	if(ppObj.fwd_orientation) {
		pattern = ppObj.sequence_fwd_regex;
	} else {
		pattern = ppObj.sequence_rev_regex;
	}
	var type;
	if(pattern.match(/^[ACGT]+$/) != null) {
		type = "nucleotideSimplePolymorphism";
	} else {
		type = "nucleotideRegexPolymorphism";
	}
	glue.inMode("reference/REF_MASTER_WUHAN_HU_1/feature-location/whole_genome", function() {
		glue.command(["create", "variation", matchVariationName, "-t", type, 
			"--nucleotide", ppObj.ref_start, ppObj.ref_end]);
		glue.inMode("variation/"+matchVariationName, function() {
			if(type == "nucleotideRegexPolymorphism") {
				glue.command(["set", "metatag", "REGEX_NT_PATTERN", pattern]);
			} else {
				glue.command(["set", "metatag", "SIMPLE_NT_PATTERN", pattern]);
			}
			glue.command(["set", "link-target", "cov_pp_seq_match", 
				"custom-table-row/cov_primer_probe/"+ppObj.id]);
		});
	});
	
	// create single nucleotide mismatch variations.
	// These look for a mismatch at a given single nucleotide location.
	// Alignment must have succeeded for a certain flanking region on 
	// either side to call the mismatch.
	var ppSeqPos = 0;
	var mismatchFlankingNts = 0; // 3 would mean 3 before, 3 after.
	for(var ntLoc = ppObj.ref_start; ntLoc <= ppObj.ref_end; ntLoc++) {
		var singleMismatchVariationName = "cov_pp_mismatch:"+ppObj.id+":"+pad(ntLoc, 6);
		var seqToScanNt = ppObj.sequence_to_scan[ppSeqPos];
		var dots = Array(mismatchFlankingNts+1).join(".");
		var regex = dots+"[^"+ntCharToAllowed[seqToScanNt].join("")+"]"+dots;
		glue.inMode("reference/REF_MASTER_WUHAN_HU_1/feature-location/whole_genome", function() {
			glue.command(["create", "variation", singleMismatchVariationName, "-t", "nucleotideRegexPolymorphism", 
				"--nucleotide", ntLoc-mismatchFlankingNts, ntLoc+mismatchFlankingNts]);
			glue.inMode("variation/"+singleMismatchVariationName, function() {
				glue.command(["set", "metatag", "REGEX_NT_PATTERN", regex]);
				glue.command(["set", "link-target", "cov_pp_seq_mismatch", 
					"custom-table-row/cov_primer_probe/"+ppObj.id]);
			});
		});
		ppSeqPos++;
	}
	
 	// create "sequence insertion" variation at specific location
 	var insertionVariationName = "cov_pp_seq_insertion:"+ppObj.id;
	glue.inMode("reference/REF_MASTER_WUHAN_HU_1/feature-location/whole_genome", function() {
		glue.command(["create", "variation", insertionVariationName, "-t", "nucleotideInsertion", 
			"--nucleotide", ppObj.ref_start, ppObj.ref_end]);
		glue.inMode("variation/"+insertionVariationName, function() {
			glue.command(["set", "metatag", "ALLOW_PARTIAL_COVERAGE", "true"]);
			glue.command(["set", "link-target", "cov_pp_seq_insertion", "custom-table-row/cov_primer_probe/"+ppObj.id]);
		});
	});
	// create "sequence deletion" variation at specific location
 	var deletionVariationName = "cov_pp_seq_deletion:"+ppObj.id;
	glue.inMode("reference/REF_MASTER_WUHAN_HU_1/feature-location/whole_genome", function() {
		glue.command(["create", "variation", deletionVariationName, "-t", "nucleotideDeletion", 
			"--nucleotide", ppObj.ref_start, ppObj.ref_end]);
		glue.inMode("variation/"+deletionVariationName, function() {
			glue.command(["set", "metatag", "ALLOW_PARTIAL_COVERAGE", "true"]);
			glue.command(["set", "link-target", "cov_pp_seq_deletion", "custom-table-row/cov_primer_probe/"+ppObj.id]);
		});
	});
});

function pad(num, size) {
    var s = num+"";
    while (s.length < size) {
    	s = "0" + s;
    }
    return s;
}

/*
 
 wuhan-hu-1 for testing
 

*/

function sequenceToRegex(sequence) {
	var seqRegex = "";
	for(var i = 0; i < sequence.length; i++) {
		var allowedChars = ntCharToAllowed[sequence[i]].join("");
		if(allowedChars.length == 1) {
			seqRegex += allowedChars;
		} else {
			seqRegex += "["+allowedChars+"]";
		}
	}
	return seqRegex;
}

function processRawSequence(rawSequence) {
	var processedSequence = rawSequence.replaceAll(" ", "");
	processedSequence = processedSequence.replaceAll("6FAM-", "");
	processedSequence = processedSequence.replaceAll("FAM-", "");
	processedSequence = processedSequence.replaceAll("-BBQ", "");
	processedSequence = processedSequence.replaceAll("-BHQ1", "");
	processedSequence = processedSequence.replaceAll("-BQH1", "");
	processedSequence = processedSequence.replaceAll("-BHQ", "");
	processedSequence = processedSequence.replaceAll("-TAMRA", "");
	for(i = 0; i < processedSequence.length; i++) {
		if("ACGTRYKMSWBDHVN".indexOf(processedSequence[i]) < 0) {
			throw new Error("Unrecognised sequence char '"+processedSequence[i]+"'");
		}
	}
	return processedSequence;
}
